import React, { Component } from 'react'

export default class Post extends Component {
    constructor(props) {
        super(props)

        this.state = {
             posts: []
        }
    }

    componentDidMount() {
        // this.fetchPost();
        fetch("http://localhost:9000/api/posts")
        .then(data => data.json())
        .then(res => {
            console.log(res);
        })
    }

    // fetchPost = () => {
    //     // const url = ;

    // }

    render() {
        return (
            <div>
                <h1>This is Post page</h1>
            </div>
        )
    }
}
